import enum
from datetime import datetime
from typing import Optional, List

class Role(enum.Enum):
    DEVELOPER = "developer"
    SYSTEM_ADMIN = "system_admin"
    DATA_MANAGER = "data_manager"
    DATA_ANALYST = "data_analyst"
    UI_DESIGNER = "ui_designer"
    PRODUCT_MANAGER = "product_manager"
    DATA_ENGINEER = "data_engineer"

class ActionType(enum.Enum):
    CREATE = "create"
    UPDATE = "update"
    DELETE = "delete"
    PUBLISH = "publish"

class SubmissionStatus(enum.Enum):
    DRAFT = "draft"
    VALIDATED = "validated"
    PUBLISHED = "published"
    REJECTED = "rejected"

class UIUpdateStatus(enum.Enum):
    PENDING = "pending"
    APPROVED = "approved"
    REJECTED = "rejected"

class User:
    def __init__(self, user_id: str, username: str, email: str, role: Role):
        self.user_id = user_id
        self.username = username
        self.email = email
        self.role = role

    def has_permission(self, required_role: Role) -> bool:
        return self.role == required_role

class Agency:
    def __init__(self, agency_id: str, name: str, code: str):
        self.agency_id = agency_id
        self.name = name
        self.code = code

class UserAgency:
    def __init__(self, user_id: str, agency_id: str):
        self.user_id = user_id
        self.agency_id = agency_id

class Submission:
    def __init__(self, submission_id: str, user_id: str, duns_number: str, status: SubmissionStatus, created_at: datetime, updated_at: datetime):
        self.submission_id = submission_id
        self.user_id = user_id
        self.duns_number = duns_number
        self.status = status
        self.created_at = created_at
        self.updated_at = updated_at

    def update_status(self, new_status: SubmissionStatus) -> None:
        self.status = new_status
        self.updated_at = datetime.now()

class ValidationRule:
    def __init__(self, rule_id: str, field_name: str, validation_regex: str, error_message: str):
        self.rule_id = rule_id
        self.field_name = field_name
        self.validation_regex = validation_regex
        self.error_message = error_message

class DUNSValidator:
    @staticmethod
    def validate(duns_number: str, action_type: ActionType) -> bool:
        if action_type == ActionType.CREATE:
            return len(duns_number) == 9 and duns_number.isdigit()
        elif action_type in [ActionType.UPDATE, ActionType.PUBLISH]:
            return len(duns_number) == 9 and duns_number.isdigit()
        return False

class HistoricalFPDSData:
    def __init__(self, record_id: str, duns_number: str, data: dict, created_at: datetime):
        self.record_id = record_id
        self.duns_number = duns_number
        self.data = data
        self.created_at = created_at

class DFileGenerator:
    @staticmethod
    def generate(submission: Submission) -> str:
        return f"D-file for submission {submission.submission_id} generated at {datetime.now()}"

class UIUpdateRequest:
    def __init__(self, request_id: str, page_name: str, requester_id: str, description: str, status: UIUpdateStatus):
        self.request_id = request_id
        self.page_name = page_name
        self.requester_id = requester_id
        self.description = description
        self.status = status

    def update_status(self, new_status: UIUpdateStatus) -> None:
        self.status = new_status

class FABSSubmission:
    def __init__(self, submission_id: str, base_data: dict):
        self.submission_id = submission_id
        self.base_data = base_data
        self.derived_data = self._derive_additional_fields()

    def _derive_additional_fields(self) -> dict:
        derived = {}
        if "amount" in self.base_data:
            derived["adjusted_amount"] = float(self.base_data["amount"]) * 1.1  # Example derivation
        return derived

class PublicationTracker:
    def __init__(self, submission_id: str, published: bool = False, published_at: Optional[datetime] = None):
        self.submission_id = submission_id
        self.published = published
        self.published_at = published_at

    def mark_published(self) -> None:
        self.published = True
        self.published_at = datetime.now()

class UIManagement:
    def __init__(self):
        self.requests = []

    def submit_request(self, request: UIUpdateRequest) -> None:
        self.requests.append(request)

    def get_requests_by_page(self, page_name: str) -> List[UIUpdateRequest]:
        return [req for req in self.requests if req.page_name == page_name]

    def approve_request(self, request_id: str) -> None:
        for req in self.requests:
            if req.request_id == request_id:
                req.update_status(UIUpdateStatus.APPROVED)
                break
